// 用堆排来做吧
function findKth(nums, n, k) {
    for (let i = Math.floor(nums.length / 2 - 1); i >= 0; i--) {
        buildHeap(nums, i, nums.length)
    }
    for (let i = 1; i < k; i++) {
        [nums[0], nums[nums.length-i]] = [nums[nums.length-i], nums[0]];
        buildHeap(nums, 0, nums.length-i)
    }
    function buildHeap(nums, i, size) {
        let largeIndex = i, left = 2 * i + 1, right = 2 * i + 2
        if (left < size && nums[largeIndex] < nums[left]) {
            largeIndex = left
        }

        if (right < size && nums[largeIndex] < nums[right]) {
            largeIndex = right
        }
        if (largeIndex !== i) {
            [nums[largeIndex], nums[i]] = [nums[i], nums[largeIndex]];
            buildHeap(nums, largeIndex, size)
        }
    }
    return nums[0]
}

